window.bookSummaryJSON = "<p><b>The enemy has been discovered, the battle lines have been drawn, and the world will never be the same.</b></p> <p>A major battle in downtown Hamburg has seen the metropolis practically leveled, demonstrating in the worst possible way how much power individuals can hold, and the world is reeling from the shock. But more members of the cult responsible for the catastrophe are still out there, and Isaac has resolved to hunt them all down, even if each attempt may unleash a fresh wave of violent calamity.</p> <p>And the political responses to the situation are predictably counterproductive: ineffective regulation that lets real monsters grow in strength while strangling efforts to save the world.</p> <p>Can Isaac fight against the whole world, working around the old order he’s trying to save while beating the cataclysm the [System] has brought with it—or will he be forced to watch humanity end for a second time?</p>"; 
